script: |
  super -f tsv -I q10928.sql | sort > q10928.out

vector: true

inputs:
  - name: q10928.sql
    data: |
      SELECT - + col0 + col2 FROM tab1 AS cor0 GROUP BY col2, col0 HAVING ( - AVG ( + col0 ) * - 26 ) NOT IN ( 39 * + col0 );
  - name: tab1

outputs:
  - name: q10928.out
    data: |
      -11
      -14
      17
